import React from 'react';
import { Pie } from 'react-chartjs-2';
import { Chart as ChartJS, Title, Tooltip, Legend, ArcElement } from 'chart.js';
import Sidebar from './Sidebar';
import { useNavigate } from 'react-router-dom';

ChartJS.register(Title, Tooltip, Legend, ArcElement);

const AdminDashboard = () => {
  const navigate = useNavigate();

  const data = {
    labels: ['Pending', 'Scheduled', 'Completed'],
    datasets: [{
      label: 'Task Status',
      data: [10, 5, 3], // Replace with your actual data
      backgroundColor: ['#ff6384', '#36a2eb', '#cc65fe'],
    }],
  };

  const options = {
    responsive: true,
    plugins: {
      legend: {
        position: 'bottom',
      },
    },
  };

  return (
    <div className="flex">
      <Sidebar />
      <div className="flex-1 p-6">
        <h1 className="text-2xl font-bold mb-6">Admin Dashboard</h1>
        <div className="flex justify-center mb-6">
          <div className="flex flex-col items-center">
            <div className="flex items-center justify-center w-32 h-32 bg-gray-700 rounded-full text-white text-xl font-semibold mb-4">
              <div>Total Number of Tasks</div>
            </div>
          </div>
        </div>
        <div className="mb-6">
          <h2 className="text-xl font-semibold mb-4">Task Analytics</h2>
          <Pie data={data} options={options} />
        </div>
        <table className="min-w-full bg-white border border-gray-300 rounded-lg shadow-md">
          <thead>
            <tr>
              <th className="py-2 px-4 border-b">Task Name</th>
              <th className="py-2 px-4 border-b">Task Description</th>
              <th className="py-2 px-4 border-b">Status</th>
              <th className="py-2 px-4 border-b">Schedule</th>
              <th className="py-2 px-4 border-b">Assigned User</th>
              <th className="py-2 px-4 border-b">Email</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td className="py-2 px-4 border-b">Task 1</td>
              <td className="py-2 px-4 border-b">Description 1</td>
              <td className="py-2 px-4 border-b">Pending</td>
              <td className="py-2 px-4 border-b">2024-08-01</td>
              <td className="py-2 px-4 border-b">User 1</td>
              <td className="py-2 px-4 border-b">user1@example.com</td>
            </tr>
            <tr>
              <td className="py-2 px-4 border-b">Task 2</td>
              <td className="py-2 px-4 border-b">Description 2</td>
              <td className="py-2 px-4 border-b">Scheduled</td>
              <td className="py-2 px-4 border-b">2024-08-05</td>
              <td className="py-2 px-4 border-b">User 2</td>
              <td className="py-2 px-4 border-b">user2@example.com</td>
            </tr>
            {/* Add more rows as needed */}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default AdminDashboard;
